import React, {Component} from 'react';
import WeatherCard from './WeatherDisplay';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';

export default class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {
      buffer: "",
    };
  }

  render() {
    return (
      <div>
        <TextField
          id="outlined-basic"
          label="Поиск по городу"
          variant="filled"
          fullWidth
          onChange={(e) => this.setState({buffer: e.target.value})}
        />
        <Button
          variant="contained"
          color="primary"
          size="large"
          onClick={() => alert(this.state.buffer)}
          >Добавить
        </Button>
      </div>
    );
  }
}
